import React from "react";
import { useKeycloak } from "@react-keycloak/web";
import Login from "./Login";

const Home = () => {
  const { keycloak, initialized } = useKeycloak();

  if (!initialized) {
    console.log(initialized);
}

  if (!keycloak.authenticated) {
    return <Login />;
  }

  return (
    <div>
      <h1>Login Success.</h1>
    </div>
  );
};

export default Home;
